	  329525,NULL,21038,NULL,1991,
	  "3.95 USD; 4.75 CAD",68.000,NULL,"Comic is a reprint of Giant-Size X-Men #1 including original ads. The stories have been recolored for this edition and therefore are different from the original issue publish in 1975. The changes made include changes to background colors and color fades particularly on faces to give them more depth.  This style of coloring came into use in the mid-80's. A comparison between this reprint and the original shows the changes clearly.  There is no information listed in the reprint to indicate that changes were made or who was responsible for recoloring the book.  Cover date is shown as \"May\" instead of \"1975.\"",
