	  329548,"7",11922,2,2006,
	  "14.99 USD; 19.99 CAD",148.000,NULL,"The saga of Yorick Brown the last man on Earth continues in PAPER DOLLS collecting issues #37-42 of writer Brian K. Vaughan's and artist Pia Guerra's hit Vertigo series. In addition to catching up on the adventures of Yorick's monkey Ampersand (whose body holds the key to stopping the male-killing plague) and telling the origin of Agent 355 PAPER DOLLS chronicles the search for Yorick's fiance Beth in Australia a search that yields a large dose of unwanted publicity for the Last Man and deadly consequences for those he cares for!",
