	  330016,"23",21173,NULL,1981,
	  "1.00 USD",36.000,NULL,"From the publisher's www site:http://www.artie.com/cascade19-23.htmIn the summer of 1980 I got involved in an animation project a rock video \"King's Elevator.\" I was losing interest in Cascade  because of the grunt labor involved in publishing it. I pre-printed the covers for issues 22 and 23 with the dates September and November 1980 on them. The issues were late (again) and the distributor made us black out the dates on the covers.This was an amazing issue. It was sold out in advance of publication. We printed about 1650 copies but we could have sold many more. It was a very fitting end to the (almost) 3-year run of Cascade. Material was collected for a 24th issue including a great S. Clay Wilson cover but it never saw print.",
	  NULL,NULL,NULL,NULL,NULL,NULL
